site.headStyle:
/* effet smooth de glissade quand on a une ancre dans une page*/
html, body {scroll-behavior: smooth;}

.col2 {
    columns: 2;
}

/* effet parralaxe avec texte https://codepen.io/ravid7000/pen/LREEzv*/
.silex-runtime .scroll-fixed {
  position: relative;
  height: 100vh;
  overflow: hidden;
}

.silex-runtime .scroll-fixed .website-width {
    position: fixed;
}

.fullwidth {
    width: 100%;
}
